INSERT INTO `campanas` VALUES (1,1,'ISBU-1','Launch event of ISBU, the Israel Security Business Union','<p style=\"text-align: center;\"><strong>Invitation to the launch event of ISBU, <br />the Israel Security Business Union <br />on 28.6/2021</strong></p>\r\n<p>&nbsp;</p>\r\n<p>[FirstName], please join us this event on<strong> 28.6.21 at 19:00 on</strong> the roof of Mindspace in Herzliya.</p>\r\n<p>This association, which was established from the Forum of CEOs from HLS &amp; Cyber industries, will improve the business cooperation of Israeli companies in Israel with government entities and abroad with the aim of creating a multiplier power with an emphasis on small and medium-sized companies to help them with the marketing processes.</p>\r\n<p>For more information about our association, visit this link <a href=\"http://www.isbunion.com\">www.isbunion.com</a></p>\r\n<p>The event is intended for the CEOs of [Company] and requires registration and a prepayment. Please here for the <a href=\"https://payboxapp.page.link/U9r89vu33BTdUAWB6\">Event Registration</a></p>\r\n<p>We look forward to see you at the event.</p>\r\n<p>On behalf of my friends from ISBU,</p>','2021-06-16 04:09:12','2021-06-16 08:09:12','2021-06-16 08:09:12'),(2,2,'ISBU-2','Launch event of ISBU, the Israel Security Business Union','<p style=\"text-align: center;\"><strong>Invitation to the launch event of ISBU, <br />the Israel Security Business Union <br />on 28.6/2021</strong></p>\r\n<p>&nbsp;</p>\r\n<p>[FirstName], please join us this event on<strong> 28.6.21 at 19:00 on</strong> the roof of Mindspace in Herzliya.</p>\r\n<p>This association, which was established from the Forum of CEOs from HLS &amp; Cyber industries, will improve the business cooperation of Israeli companies in Israel with government entities and abroad with the aim of creating a multiplier power with an emphasis on small and medium-sized companies to help them with the marketing processes.</p>\r\n<p>For more information about our association, visit this link <a href=\"http://www.isbunion.com\">www.isbunion.com</a></p>\r\n<p>The event is intended for the CEOs of [Company] and requires registration and a prepayment. Please here for the <a href=\"https://payboxapp.page.link/U9r89vu33BTdUAWB6\">Event Registration</a></p>\r\n<p>We look forward to see you at the event.</p>\r\n<p>On behalf of my friends from ISBU,</p>','2021-06-16 04:10:40','2021-06-16 08:10:40','2021-06-16 08:10:40'),(3,3,'ISBU-3','Launch event of ISBU, the Israel Security Business Union','<p style=\"text-align: center;\"><strong>Invitation to the launch event of ISBU, <br />the Israel Security Business Union <br />on 28.6/2021</strong></p>\r\n<p>&nbsp;</p>\r\n<p>[FirstName], please join us this event on<strong> 28.6.21 at 19:00 on</strong> the roof of Mindspace in Herzliya.</p>\r\n<p>This association, which was established from the Forum of CEOs from HLS &amp; Cyber industries, will improve the business cooperation of Israeli companies in Israel with government entities and abroad with the aim of creating a multiplier power with an emphasis on small and medium-sized companies to help them with the marketing processes.</p>\r\n<p>For more information about our association, visit this link <a href=\"http://www.isbunion.com\">www.isbunion.com</a></p>\r\n<p>The event is intended for the CEOs of [Company] and requires registration and a prepayment. Please here for the <a href=\"https://payboxapp.page.link/U9r89vu33BTdUAWB6\">Event Registration</a></p>\r\n<p>We look forward to see you at the event.</p>\r\n<p>On behalf of my friends from ISBU,</p>','2021-06-16 04:11:39','2021-06-16 08:11:39','2021-06-16 08:11:39'),(4,4,'Rosh-lista1','Visita durante estas fiestas','<p>[FirstName], hoy tres personas me preguntaron por ti y me dijeron que quer&iacute;an visitarte para las fiestas y quedarse contigo.</p>\r\n<p>Les pregunte sus nombres y me contestaron: Mazal, Parnasa y Salud</p>\r\n<p>Entonces, les dije que eres una gran persona, les di tu direcci&oacute;n y les coment&eacute; que pod&iacute;an quedarse contigo todo el a&ntilde;o.</p>\r\n<p>Aprovecho estas fiestas para enviarte un fuerte abrazo y que Hashem bendiga con todo lo bueno a la familia [LastName].</p>\r\n<p>Shana Tova y Gmar Jatima Tova</p>\r\n<p>Saludos desde Israel</p>','2021-09-07 21:50:27','2021-09-08 01:50:27','2021-09-08 01:50:27'),(5,5,'Rosh-Lista2','Visita durante estas fiestas','<p>[FirstName], hoy tres personas me preguntaron por ti y me dijeron que quer&iacute;an visitarte para las fiestas y quedarse contigo.</p>\r\n<p>Les pregunte sus nombres y me contestaron: Mazal, Parnasa y Salud</p>\r\n<p>Entonces, les dije que eres una gran persona, les di tu direcci&oacute;n y les coment&eacute; que pod&iacute;an quedarse contigo todo el a&ntilde;o.</p>\r\n<p>Aprovecho estas fiestas para enviarte un fuerte abrazo y que Hashem bendiga con todo lo bueno a la familia [LastName].</p>\r\n<p>Shana Tova y Gmar Jatima Tova</p>\r\n<p>Saludos desde Israel</p>','2021-09-07 21:51:40','2021-09-08 01:51:40','2021-09-08 01:51:40'),(6,6,'Rosh-Lista3','Visita durante estas fiestas','<p>[FirstName], hoy tres personas me preguntaron por ti y me dijeron que quer&iacute;an visitarte para las fiestas y quedarse contigo.</p>\r\n<p>Les pregunte sus nombres y me contestaron: Mazal, Parnasa y Salud</p>\r\n<p>Entonces, les dije que eres una gran persona, les di tu direcci&oacute;n y les coment&eacute; que pod&iacute;an quedarse contigo todo el a&ntilde;o.</p>\r\n<p>Aprovecho estas fiestas para enviarte un fuerte abrazo y que Hashem bendiga con todo lo bueno a la familia [LastName].</p>\r\n<p>Shana Tova y Gmar Jatima Tova</p>\r\n<p>Saludos desde Israel</p>','2021-09-07 21:52:34','2021-09-08 01:52:34','2021-09-08 01:52:34');
